import React, {Component} from 'react';
import {Router, Link} from '@reach/router';

const Nav = () => {
	return (
		<nav className="Topnav">
      <Link Topnav-Button to="/">Home</Link>
			<Link to="/articles">Articles</Link>
		</nav>
	);
};

export default Nav;
